import React from 'react'

const Card = (props) => {
    const options =props.option;
    const priceOption=Object.keys(options);
    return (
        <div>
            <div className="card m-5" style={{ "width": "18rem", "maxHeight": "300px" }}>
                <img src={props.img} className="card-img-top" alt="..." style={{height:"150"}}/>
                <div className="card-body">
                    <h5 className='card-title'>{props.foodname}</h5>
                    {/* <p className="card-text">{props.des}</p> */}
                    <div className='container w-100'>
                        <select className='bg-success m-2 h-70 rounded'>
                            {Array.from(Array(4), (e, i) => {
                                return <option key={i + 1} value={i + 1}>{i + 1}</option>
                            })}
                        </select>
                        <select className='bg-success m-2 h-70  rounded'>
                             {priceOption.map((data)=>{
                                 return  (<option key={data} value={data}>{data}</option>)
                             })}
                        </select>
                        <div className='d-inline h-100 fs-5'> Price</div>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default Card;
